// pages/HomePage/CallToAction.js
import React from "react";
import "../../styles/HomePage/CallToAction.css";

const CallToAction = () => {
  return (
    <section className="cta-section">
      <h2>Ready to Get Started?</h2>
      <p>Join thousands of users improving their healthcare experience.</p>
      <button className="btn primary-btn">Create Your Account</button>
    </section>
  );
};

export default CallToAction;
